```sparql
SELECT DISTINCT ?player ?playerLabel WHERE {
  ?player wdt:P106 wd:Q937857;  # Occupation: association football player
          wdt:P27 ?citizenship1, ?citizenship2.
  FILTER (?citizenship1 != ?citizenship2)
